import './Logo.css';
import React from 'react';
import logo from '../../assets/imagens/logo.jpg';

export default function Logo(props){
    return (
        <><h1>AutoLasanhas</h1>
        <aside className="logo">
            <a href="/" className="logo">
                <img src={logo} alt="Logo" />
            </a>
        </aside></>
    )
}
